import './App.css';
import React from 'react';
import {BrowserRouter, Routes, Route} from "react-router-dom";
import RestAPI from './pages/RestAPI.js';
import Main from './pages/Main';
import NotFound from './pages/NotFound';
import ImageList from './pages/ImageList';
import Login from './pages/Login';
import Navbar from './components/Navbar';
// import { AiOutlinePicture } from "react-icons/ai";

function App() {
  return (
    <>
      <div className="App">
        <BrowserRouter>
          <Navbar/>
          {/* <AiOutlinePicture  className='react-icon'/> */}
            <Routes>
                <Route path='/' element={<dnd/>}></Route>
                <Route path='/1' element={<Main/>}></Route>
                <Route path='/main' element={<RestAPI/>}></Route>
                <Route path='/ImageUpload' element={<RestAPI/>}></Route>
                <Route path='/ImageList' element={<ImageList/>}></Route>
                <Route path='/Login' element={<Login/>}></Route>
                <Route path='*' element={<NotFound/>}></Route>
            </Routes>
        </BrowserRouter>
      </div>
    </>
  );
}

export default App;
